import addData from "./dbCon";
import Layout from "../components/layout";

const Mock = () => (
  <Layout>
    <h1 style={{ color: "white" }}>Deneme</h1>
    <input type="text" placeholder="Type something..." id="input" />
    <button
      id="submit"
      onClick={e => addData(document.getElementById("input").value)}
    >
      Submit
    </button>
    <p style={{ color: "red" }} hidden>Blank input!</p>
  </Layout>
);

export default Mock;
